import React, { useState, useEffect } from 'react'
import { json, useLocation, useNavigate } from "react-router-dom"
import { StyleSheet, View, Text, SafeAreaView } from 'react-native'
import { nanoid } from 'nanoid'
import { MdHome } from 'react-icons/md'
import { MdAddCircle } from 'react-icons/md'
import NotesList from './NotesList'
import Search from './Search'
import Header from './Header'
import Navbar from "./Navbar"
import NavbarAccount from "./NavbarAccount"
import "./assets/css/main.css"
import Axios from 'axios'


export default function MainPage({ navigation }) {
	const session = localStorage.getItem('session')

	const navigate = useNavigate();
	const path = useLocation();

	let ses = session;
	let nav = '';

	if (ses === null) {
		nav = <Navbar />
	} else {
		nav = <NavbarAccount />
	}

	const [notes, setNotes] = useState([
		{
			id: nanoid(),
			key: 'Зразок',
			text: 'Тут ключ',
			date: 'Місце для передавання ключа',
			today: '25/10/2023'
		},
	]);

	const [searchText, setSearchText] = useState('');

	useEffect(() => {
		const savedNotes = JSON.parse(
			localStorage.getItem('noteslist')
		);

		if (savedNotes) {
			setNotes(savedNotes);
		}
	}, []);

	useEffect(() => {
		localStorage.setItem(
			'noteslist',
			JSON.stringify(notes)
		);
	}, [notes]);

	const [data, setData] = useState ([])

	data.map((notes) => {
		console.log(notes.noteslist)
		localStorage.setItem('noteslist', (notes.noteslist))
	})

	const handleSubmit = () => {
	Axios.get('http://localhost:19007/MainPage', { params: { session: session } })
	.then(res => { setData(res.data) 
	navigation.navigate('MainPage') })
	}

	const deleteNote = (id) => {
		const newNotes = notes.filter((note) => note.id !== id);
		setNotes(newNotes);

		function s1() {
			const session = localStorage.getItem('session')
			const noteslist = localStorage.getItem('noteslist')

			const values = {
			noteslist: noteslist,
			session: session,
			}

			console.log(values)
			Axios.put("http://localhost:8081/notes", values)
			}
			setTimeout(s1, 400)
	};

  	return (
    <div id="page-wrapper">
    {nav}

    <SafeAreaView>
			<View>
				<View style={styles.btns}>
					<View style={styles.middle}>
					<MdHome color='#9e5cf6'
						size='2.1em'
					/>
						<Text style={styles.text}>В меню</Text>
					</View>
					<View style={styles.middle}>
					<MdAddCircle color='#9e5cf6'
						size='1.9em'
					/>
						<Text style={styles.text}>Додати</Text>
					</View>
				</View>

					<Header></Header>
					<Search handleSearchNote={setSearchText} />
					<NotesList
						notes={notes.filter((note) =>
							note.text.toLowerCase().includes(searchText)
						)}
						handleDeleteNote={deleteNote}
					/>
			</View>
		</SafeAreaView>


		<div id="footer">
			<div className="copyright">
				<ul className="menu">
					<li>&copy; JavaScript. All rights reserved</li><li>Design: <a href="http://">Tockyj Bohdan</a></li>
				</ul>
			</div>
        </div>
    </div>
  	)
}

const styles = StyleSheet.create({
	middle: {
		display: 'flex',
		flexDirection: 'row',
		alignItems: 'center',
		justifyContent: 'space-between',
	},
	btns: {
		display: 'flex',
		flexDirection: 'row',
		alignItems: 'center',
		justifyContent: 'space-between',
		width: '90%',
		marginLeft: '4%',
		marginTop: 20,
	},
	text: {
		fontSize: 20,
		marginTop: -1,
		marginLeft: 1,
	},
	txt: {
		fontSize: 16,
		marginTop: 12,
		marginBottom: 4,
		color: '#888'
	},
	txtdef: {
		fontSize: 16,
		color: '#888'
	},
	middletxt: {
		alignItems: 'center',
	},
});
